import React from "react";

const NotFound = ({ history }) => (
  <div>
    <h3>404</h3>
    <div>
      <h2>Page Not Found</h2>
      <Button size="small" color="primary" onClick={() => history.push("/")}>
        Go Home
      </Button>
    </div>
  </div>
);

export default NotFound;
